import * as variable from "variables/Variables";
/**
 * * Hàm sẽ trả về 1 mảng với các phần tử là những ngày tháng
 */
export function createDates(arr) {
  let newArr = [];
  arr.map((obj) => {
    newArr.push(obj[variable.createDate]);
  });
  return newArr;
}

/**
 * * hàm sẽ trả về 1 mảng mà ko có ngày trung với nhau
 * @param {*} arr
 */
export function removeDuplicateDate(arr) {
  let newArr = [];
  const uniqueSet = new Set(arr);
  return (newArr = { ...uniqueSet });
}
